import React from 'react';
import { Fade } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'


const Slideshow = (props) => {

  const { images, title } = props.project

  const fadeImages = [...images]
  // const fadeImages = [
  //   {
  //   url: images[0]
  //   },
  //   {
  //   url: images[1]
  //   },
  //   {
  //   url: images[2]
  //   },
  // ];

  // const fadeImages = [{}]

  // fadeImages.forEach(url => {
  //   url.push(images)
  // })

  // images.forEach(image => {
  //   fadeImages.push(image)
  // });
  // function imageUrls () {
  //   let url = {}
  //    for (let i = 0; i < image.length; i++) {
  //       url = image
  //     }
  // }

  //   const fadeImages = [
  //     url = imageUrls()
  //   ]

  const properties = {
    arrows: false,
    duration: 2500,
    transitionDuration: 500
  }

  return (
    <div className="slide-container">
      <Fade {...properties}>
        {fadeImages.map((fadeImage, index) => (
          <div className="each-fade" key={index}>
            <div classNameName="image-container">
              <img src={fadeImage.url} alt={title}/>
            </div>
          </div>
        ))}
      </Fade>
      <div className="un-photo" style="background-image: url('https://s3-us-west-2.amazonaws.com/s.cdpn.io/39255/Vela-Stephen.jpg'); --row-total: 5;">
          <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/39255/Vela-Stephen.jpg" />

            <div className="un-photo__popup">
              <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/39255/Vela-Stephen.jpg" />
              <div className="un-photo__row" style="--row-index: 0; --random: 0.23">
                <div className="un-photo__row-inner"></div>
              </div>
              <div className="un-photo__row" style="--row-index: 1; --random: 0.72">
                <div className="un-photo__row-inner"></div>
              </div>
              <div className="un-photo__row" style="--row-index: 2; --random: 0.11">
                <div className="un-photo__row-inner"></div>
              </div>
              <div className="un-photo__row" style="--row-index: 3; --random: 0.50">
                <div className="un-photo__row-inner"></div>
              </div>
              <div className="un-photo__row" style="--row-index: 4; --random: 0.39;">
                <div className="un-photo__row-inner"></div>
              </div>
            </div>
      </div>
    </div>
  )
}
export default Slideshow
